11の使い方のできるマルチツールを財布にも入るカードサイズで実現！<br>
キャンプや登山、ちょっとした作業などなど
あらゆる場面で活躍します。<br>
<br>
持ち運びに便利なカードタイプで収納ケースも付いてます。<br>
<br>
いざ！という時に一家に1台ぜひご用意ください。<br>
<br>
缶切りやナイフなどあれば便利な機能が11種類と満載です。<br>
<br>
機能一覧<br>
・缶切り<br>
・ナイフ<br>
・ネジ回し<br>
・物差し（4cm）<br>
・栓抜き<br>
・六角レンチ（4サイズ）<br>
・蝶ネジレンチ<br>
・ノコギリ<br>
・方位測定<br>
・六角レンチ（2サイズ）<br>
・キーホール<br>
サイズ：約7cm×4.5cm 厚さ0.2cm<br>
